import React, { useState } from 'react';

const PreferenceEditModal = ({ preferencesData, onSave, onClose }) => {
    const [editedData, setEditedData] = useState(preferencesData);

    // Обработчик изменения данных в форме
    const handleChange = (e) => {
        const { name, value } = e.target;
        setEditedData((prevData) => ({
            ...prevData,
            [name]: value,
        }));
    };

    const handleSave = () => {
        onSave(editedData);
        onClose();
    };

    return (
        <div className="modal">
            <div className="modal-content">
                <h2>Редактировать предпочтение</h2>
                <form>
                    <label>
                        Город:
                        <input
                            type="street"
                            name="city"
                            value={editedData?.city || ''}
                            onChange={handleChange}
                        />
                    </label>
                    <label>
                        Район:
                        <input
                            type="text"
                            name="district"
                            value={editedData?.district || ''}
                            onChange={handleChange}
                        />
                    </label>
                    <label>
                        Улица:
                        <input
                            type="text"
                            name="Улица"
                            value={editedData?.street || ''}
                            onChange={handleChange}
                        />
                    </label>
                    <label>
                        Площадь минимум:
                        <input
                            type="number"
                            name="Площадь"
                            value={editedData?.minArea || ''}
                            onChange={handleChange}
                        />
                    </label>
                    <label>
                        Площадь максимум:
                        <input
                            type="number"
                            name="Площадь"
                            value={editedData?.maxArea || ''}
                            onChange={handleChange}
                        />
                    </label>
                    <label>
                        minPrice:
                        <input
                            type="number"
                            name="minPrice"
                            value={editedData?.minPrice || ''}
                            onChange={handleChange}
                        />
                    </label>
                    <label>
                        maxPrice:
                        <input
                            type="number"
                            name="maxPrice"
                            value={editedData?.maxPrice || ''}
                            onChange={handleChange}
                        />
                    </label>

                    <label>
                        roomsCount:
                        <input
                            type="number"
                            name="roomsCount"
                            value={editedData?.roomsCount || ''}
                            onChange={handleChange}
                        />
                    </label>
                    <label>
                        hasBalcony:
                        <input
                            type="checkbox"
                            name="hasBalcony"
                            value={editedData?.hasBalcony || ''}
                            onChange={handleChange}
                        />
                    </label>
                    <label>
                        allowPets:
                        <input
                            type="checkbox"
                            name="allowPets"
                            value={editedData?.allowPets || ''}
                            onChange={handleChange}
                        />
                    </label>
                    <label>
                        additionalNotes:
                        <input
                            type="text"
                            name="additionalNotes"
                            value={editedData?.additionalNotes || ''}
                            onChange={handleChange}
                        />
                    </label>
                    {/* Добавьте остальные поля по аналогии */}
                    <button type="button" onClick={handleSave}>Сохранить</button>
                    <button type="button" onClick={onClose}>Закрыть</button>
                </form>
            </div>
        </div>
    );
};

export default PreferenceEditModal;
